import React, {Component} from 'react';
import {Layout, Header, Navigation,Content} from 'react-mdl';
import {Navbar, Container} from 'react-bootstrap';

class LandingPage extends Component {
    render(){
        return (
            <div style={{height: '300px', position: 'relative'}}>
    <Layout style={{background: 'url(https://images.ctfassets.net/pjnu85utzlm3/1dG0B1I5UxkLpauORKuSVB/fe9e167656ebe99692619c37ca6624f6/nastuh-abootalebi-eHD8Y1Znfpk-unsplash.jpg) center / cover'}}>
        <Header transparent title="Find Any contractor that you want" style={{color: 'white'}}>
            <Navigation>
                <a href="Home">Link</a>
                <a href="Categories">Link</a>
                <a href="Find Contractor">Link</a>
                <a href="Contact">Link</a>
            </Navigation>
        </Header>
        <Content />
    </Layout>
    <Container>
  <Navbar expand="lg" variant="light" bg="light">
    <Navbar.Brand href="#">Navbar</Navbar.Brand>
  </Navbar>
</Container>
 </div>
      /// Adding the cards to the center of the screen /////
      
    
        )
    }
}

export default LandingPage;
